import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './header.css';

import {
  Brand,
  Facebook,
  Twiter,
  Linkedin,
  Youtube,
  Instagram
} from "../../../assets/images/image";


const  Header = () => {

  return (
    <div className="header"> 
      <Navbar expand="md" bg="light" variant="dark">
        <Container> 
            <Navbar.Brand>
              <img src={Brand} className="img-fluid" alt="logo" />
            </Navbar.Brand>
            <div className="nav__social">
                <ul>
                  <li><a href="https://www.facebook.com/thetripvalet" target='_blank'><img width="20" src={Facebook} /></a></li>
                  {/* <li><a href="/"><img width="20" src={Twiter} /></a></li> */}
                  {/* <li><a href="/"><img width="20" src={Linkedin} /></a></li> */}
                  {/* <li><a href="/"><img width="20" src={Youtube} /></a></li> */}
                  <li><a href="https://instagram.com/tripvalet"  target='_blank'><img width="20" src={Instagram} /></a></li>
                </ul>
            </div>            
        </Container>
      </Navbar>
    </div>      
  );
}

export default Header;
